    [TestFixture]
    internal class RegisterTest
    {
        private RegisterController _registerController;
        private Mock<IConfiguration> _configuration;
        private Mock<IUserService> _userService;
        private Mock<IUserRepository> _userRepository;
        private Mock<IImageService> _imageService;

        [SetUp]
        public void Setup()
        {
            _configuration = new Mock<IConfiguration>();
            _userRepository = new Mock<IUserRepository>();
            _userService = new Mock<IUserService>();
            _imageService = new Mock<IImageService>();

            UserProfile userProfile = new UserProfile();
            var configuration = new MapperConfiguration(c => c.AddProfile(userProfile));

            _registerController = new RegisterController(_configuration.Object, _userService.Object, _userRepository.Object, _imageService.Object);
        }

        [Test]
        public void RegisterUser_PassError_ReturnFalse()
        {
            // Arrange
            UserRegistrationDTO user = new UserRegistrationDTO()
            {
                UserName = "Test",
                Email = "test@email.com",
                Password = "123",
                ConfirmationPassword = "123",
                ProfilePicture = "asdf"
            };

            // Act
            var result = _registerController.Register(user) as BadRequestObjectResult;

            // Asserts
            Assert.IsNotNull(result);
            Assert.That(result.StatusCode, Is.EqualTo(400));
            Assert.IsNotNull(result.Value);
            Assert.IsInstanceOf<IResponse>(result.Value);
            Assert.That((result.Value as IResponse).Success, Is.False);
            Assert.That((result.Value as IResponse).Message, Is.EqualTo("La contraseña debe tener al menos: 8 carácteres de largo, una letra mayúscula, otra minúscula y al menos un número."));
        }

        [Test]
        public void RegisterUser_ConfirmationPassError_ReturnFalse()
        {
            // Arrange
            UserRegistrationDTO user = new UserRegistrationDTO()
            {
                UserName = "Test",
                Email = "test@email.com",
                Password = "asdf1FF#",
                ConfirmationPassword = "123",
                ProfilePicture = "asdf"
            };

            // Act
            var result = _registerController.Register(user) as BadRequestObjectResult;

            // Assert
            Assert.IsNotNull(result);
            Assert.That(result.StatusCode, Is.EqualTo(400));
            Assert.IsNotNull(result.Value);
            Assert.IsInstanceOf<IResponse>(result.Value);
            Assert.That((result.Value as IResponse).Success, Is.False);
            Assert.That((result.Value as IResponse).Message, Is.EqualTo("Las contraseñas no coinciden."));
        }

